-- ----------------------------
-- Procedure structure for `DoOrderInfo`
-- ----------------------------
DROP PROCEDURE IF EXISTS `DoOrderInfo`;
DELIMITER ;;
CREATE DEFINER=`root`@`127.0.0.1` PROCEDURE `DoOrderInfo`(_gameid INT(11) UNSIGNED, _zoneid  INT(11) UNSIGNED, _sdkid VARCHAR(50), _platform VARCHAR(50), _id VARCHAR(50), _orderid VARCHAR(50), _paytype VARCHAR(50),
	_amount INT(11) UNSIGNED, _sign VARCHAR(50), _paytime DATETIME, _placeordertime DATETIME)
BEGIN 
	DECLARE ncount INT(11) UNSIGNED;
	DECLARE msg VARCHAR(50);
	DECLARE nret INT(11);
	DECLARE ngoodsid INT(11) UNSIGNED DEFAULT 0;
	DECLARE ngoodsnum INT(11) UNSIGNED DEFAULT 0;
	DECLARE vaccount VARCHAR(50) DEFAULT '';
	DECLARE nroleid INT(11) UNSIGNED DEFAULT 0;
	DECLARE nisdo INT(11) DEFAULT 0;
	  
	SELECT COUNT(f_id), f_goodsid, f_goodsnum, f_account, f_roleid, f_isdo INTO ncount, ngoodsid, ngoodsnum, vaccount, nroleid, nisdo 
						FROM t_inner_order_info WHERE f_id = _id AND f_gameid = _gameid AND f_zoneid = _zoneid AND f_platform = f_platform;
	IF ncount >= 1 THEN
			IF nisdo = 1 THEN
				SET msg = 'done';
				SET nret = 0;
				SELECT nret, msg;
			ELSE
				SET msg = 'sucess';
				SET nret = 1;
				UPDATE t_inner_order_info SET f_orderid = _orderid, f_paytype = _paytype, f_amount = _amount,f_sign = _sign, f_paytime =  _paytime, f_placeorder_time = _placeordertime, f_isdo = 1
					WHERE f_id = _id AND f_gameid = _gameid AND f_zoneid = _zoneid AND f_platform = _platform;
				SELECT nret, msg, ngoodsid, ngoodsnum, vaccount, nroleid;
			END IF;
	ELSE
		SET msg = 'error';
		SET nret = 0;
		SELECT nret, msg;
	END IF;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `GenerateInnerOrderId`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GenerateInnerOrderId`;
DELIMITER ;;
CREATE DEFINER=`root`@`127.0.0.1` PROCEDURE `GenerateInnerOrderId`(_gameid INT(11), _zoneid  INT(11), _goodsid INT(11), _goodsnum INT(11),
 _account VARCHAR(50), _roleid INT(11), _sdkid VARCHAR(50), _platform VARCHAR(50))
BEGIN
        DECLARE nid VARCHAR(50) ;
  
	DECLARE generatetime VARCHAR(50) ;
	
	SET generatetime = DATE_FORMAT(NOW(),'%Y%m%d%H%i%S');
	SET nid = CONCAT('DD', _platform,'_', _gameid,'_', _zoneid,'_', _roleid, '_', generatetime);
	
	                    VALUES(nid, _goodsid, _goodsnum, _gameid, _zoneid, _account, _roleid, _sdkid,_platform);
	SELECT nid;
END
;;
DELIMITER ;

