-- Procedure structure for `insert_boss_rank`
-- ----------------------------
DROP PROCEDURE IF EXISTS `insert_boss_rank`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_boss_rank`(_player_id int(32), _result int(32), _times int(32))
    SQL SECURITY INVOKER
BEGIN
	#Routine body goes here...
	DECLARE			_temp_id 		int(32);
	
	SET _temp_id = 0;
	SELECT PlayerID FROM active_boss_rank WHERE PlayerID=_player_id INTO _temp_id;
	IF(0=_temp_id) THEN  # not exist data
	ELSE
		UPDATE active_boss_rank SET result=_result, times=_times WHERE PlayerID=_player_id;
	END IF;
END
;;
DELIMITER ;


-- ----------------------------
-- Procedure structure for `insert_player_role`
-- ----------------------------
DROP PROCEDURE IF EXISTS `insert_player_role`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_player_role`(_zoneid int(10) unsigned, _account_id INT(10) unsigned, _nick_name varCHAR(32), _profession INT(10) unsigned, _energy INT(10) unsigned, _current_weapon int(10) unsigned, _current_suit int(10) unsigned,
	_createtime int(10) unsigned,_platform VARCHAR(32))
    SQL SECURITY INVOKER
role_pro:BEGIN
        DECLARE         retPlayerId1   int(10) unsigned default 0;
        DECLARE         retPlayerId2   INT(10) UNSIGNED DEFAULT 0;
        DECLARE         retPlayerId3   INT(10) UNSIGNED DEFAULT 0;
        DECLARE         retPlayerId4   INT(10) UNSIGNED DEFAULT 0;
        DECLARE         retAccId       INT(10) UNSIGNED DEFAULT 0;
        declare         retPlayerId    int(10) unsigned default 0;
        
        select last_insert_id() into retPlayerId;
        set retPlayerId = retPlayerId + _zoneid * 10000000;
   
        
        SELECT f_accountid, f_playerid1, f_playerid2, f_playerid3, f_playerid4 FROM t_account WHERE f_accountid = _account_id
                 INTO retAccId, retPlayerId1, retPlayerId2, retPlayerId3, retPlayerId4;
                 
        IF(0=retAccId) THEN
                SELECT f_accountid, f_playerid1, f_playerid2, f_playerid3, f_playerid4 FROM t_account WHERE f_accountid = _account_id
                 INTO retAccId, retPlayerId1, retPlayerId2, retPlayerId3, retPlayerId4;
        END IF;
        
        
        IF ('0'=retPlayerId1) THEN
                UPDATE t_account SET f_playerid1 = retPlayerId WHERE f_accountid=_account_id;
        ELSEIF ('0'=retPlayerId2) THEN
                UPDATE t_account SET f_playerid2 = retPlayerId WHERE f_accountid=_account_id;
        ELSEIF ('0'=retPlayerId3) THEN
                UPDATE t_account SET f_playerid3 = retPlayerId WHERE f_accountid=_account_id;
        ELSEIF ('0'=retPlayerId4) THEN
                UPDATE t_account SET f_playerid4 = retPlayerId WHERE f_accountid=_account_id;
        END IF;
        
        select retPlayerId;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `insert_pvp_rank`
-- ----------------------------
DROP PROCEDURE IF EXISTS `insert_pvp_rank`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `insert_pvp_rank`(_player_id int(32), _left_times int(32))
    SQL SECURITY INVOKER
pvp_pro:BEGIN
	# 当角色达到等级限制后, 将初始数据插入表中, 并返回排名
	DECLARE  	retPlayerId    int(32) DEFAULT 0;
	DECLARE 	currRank			 int(32) DEFAULT 0;
	#DECLARE		currMaxRank		 int(32) DEFAULT 0;
	SELECT PlayerID, rank FROM active_pvp_rank WHERE PlayerID = _player_id INTO retPlayerId, currRank;
	if(0!=retPlayerId) THEN
		SELECT 'right', currRank;
		LEAVE pvp_pro;
	END IF;
	#SELECT active_pvp_rank.rank FROM active_pvp_rank ORDER BY rank INTO currMaxRank; 
	#SET currMaxRank = currMaxRank + 1;
	SELECT COUNT(*) FROM active_pvp_rank INTO currRank;
	UPDATE active_pvp_rank SET rank= currRank WHERE PlayerID = _player_id;
	SELECT 'right', currRank;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `query_boss_rank`
-- ----------------------------
DROP PROCEDURE IF EXISTS `query_boss_rank`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `query_boss_rank`(_player_id int(32))
    SQL SECURITY INVOKER
BEGIN
	#Routine body goes here...
	DECLARE		_my_rank 						INT(32) DEFAULT 0;  # 自己的排名
	SET @rowNum =0;
	SELECT rowNo FROM
		(Select PlayerID, (@rowNum:=@rowNum+1) as rowNo
		From active_boss_rank 
		Order by active_boss_rank.result DESC ) AS b
		WHERE PlayerID = _player_id INTO _my_rank;
	SELECT _my_rank;
END
;;
DELIMITER ;


